import React from "react";
import gameplay from '../../public/images/gameplay.png'

function MiddleSection() {
  return (
    <div>
      <div className="gameplay-div">
        <img
          className="gameplay-img"
          src="public/images/gameplay.png"
          alt="Gameplay"
        />
      </div>
    </div>
  );
}

export default MiddleSection;
